import React from 'react';

const Footer = () => (
    <div className='container-fluid' style={{ textAlign: 'center', color: 'white', height: '7vh', background: '#BEB19B', fontFamily: 'Didot', }}>
      <div style={{ height: '2vh' }} />
      ©️ 2020 Expresso
      <div style={{ height: '2vh' }} />
    </div>
);

export default Footer;
